import React from 'react'
import { useParams } from 'react-router'
import { getProductosById } from '../../utils/getProductosById'

const producto = () => {
    const {id} = useParams()
    const producto = getProductosById(id)

    return (
        <div>
            <h1>{producto.titulo}</h1>

        </div>
    )
}

export default producto
